import { Injectable } from '@angular/core';
import * as jsPDF from 'jspdf';

@Injectable({ providedIn: 'root' })
export class JsPDFFontService {
    fontNormal = '';
    fontBold = '';

    AddFont(doc){
        (doc as any).addFileToVFS('DRUCKSCHRIFT.ttf', this.fontNormal);
        (doc as any).addFileToVFS('DRUCKSCHRIFT_BOLD.ttf', this.fontBold);
        doc.addFont('DRUCKSCHRIFT.ttf', 'Schulschrift', 'normal');
        doc.addFont('DRUCKSCHRIFT_BOLD.ttf', 'Schulschrift', 'normal');
        doc.setFont('Schulschrift');
    }
}